import * as React from 'react';
import { Logo, Numbers, Title, ScrollButton } from './components';
import './header.scss';

const Header: React.FC = () => {
  const [isShownContent, setIsShownContent] = React.useState(false);

  React.useEffect(() => {
    setTimeout(() => {
      setIsShownContent(true);
    }, 10000);
    return () => {
      setIsShownContent(false);
    };
  }, []);

  return (
    <div className={'header-wrapper'}>
      <Logo />
      <Numbers />
      {isShownContent && (
        <div className="content-wrapper">
          <Title />
          <ScrollButton />
        </div>
      )}
    </div>
  );
};

export { Header };
